utils.waitForElement('.o-section-benefits-container').then(function (pricing) {
	pricing.insertAdjacentHTML('afterend', templates);

	const navButtons = document.querySelectorAll('button.c-switcher-nav-item');
	const templateImages = document.querySelectorAll('.c-switcher-item');

	let step = 0;
	let interval;

	function startInterval() {
		interval = setInterval(() => {
			navButtons.forEach(btn => btn.classList.remove('is-active'));
			navButtons.forEach(btn => btn.querySelector('.progress-bar').removeAttribute('style'));
			templateImages.forEach(img => img.classList.remove('is-visible', 'has-animated'));

			navButtons[step].classList.add('is-active');
			navButtons[step].querySelector('.progress-bar').style = "transition: width 7000ms linear; width: 100%;";
			templateImages[step].classList.add('is-visible', 'has-animated');

			step++;
			if (step > 3) step = 0;
		}, 7000);
	};
	startInterval();

	navButtons.forEach((button, index) => {
		button.addEventListener('click', () => {
			navButtons.forEach(btn => btn.classList.remove('is-active'));
			navButtons.forEach(btn => btn.querySelector('.progress-bar').removeAttribute('style'));
			templateImages.forEach(img => img.classList.remove('is-visible', 'has-animated'));

			button.classList.add('is-active');
			navButtons[index].querySelector('.progress-bar').style = "width: 100%;";
			templateImages[index].classList.add('is-visible', 'has-animated');

			clearInterval(interval);
			step = index + 1;
			if (step > 3) step = 0;

			startInterval();
		});
	});
});
